  import  {FoodCard} from './components/card';
  import db from './DB';


function App() {
  const {weeklySpecial,Topseller,Featured}=db
  return (
    <div className="App">
     <div className='weekly'>

      <div className='wtext'>
        <p>Weekly Special</p>
        </div>

        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>   

        </div>


      {
Featured.map((datum)=>{
  return( <FoodCard datum={datum}/> )

})
