      </div>

{/* //top */}





      <div className='top'>

      <div className='wtext'>
        <p>Top seller</p>
        </div>





        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>





        </div>


      {
Topseller.map((datum)=>{
  return( <FoodCard datum={datum}/> )

})
      }


      </div>



      <div className='fea'>


      <div className='wtext'>
        <p>Featured Products</p>
        </div>





        <div className='vtext'>
        <p>view all </p>


        <FontAwesomeIcon className='ico'icon={ faArrowRight }></FontAwesomeIcon>





        </div>


      {
weeklySpecial.map((datum)=>{
  return( <FoodCard datum={datum}/> )

